import {
  Container,
  Grid,
  Typography,
  Card,
  CardContent,
  Table,
  TableHead,
  TableBody,
  TableRow,
  TableCell,
  Button,
} from '@material-ui/core';
import Popup from './popup';
import React, { useState } from 'react';


const JobList = ({ jobs, users }) => {
  const [showPopup, setShowPopup] = useState(false);
  const [selectedJob, setSelectedJob] = useState(null);

  const handleShowApplicants = (job) => {
    setSelectedJob(job);
    setShowPopup(true);
  };

  const filteredUsers = selectedJob
    ? users.filter((user) => user.jobId === selectedJob.id)
    : [];

  return (
    <Container maxWidth="lg">
      <Typography variant="h4" align="center" style={{ marginBottom: '2rem' }}>
        Current Jobs
      </Typography>
      {jobs.map((job) => (
        <Card
          className="hover:animate-pulse m-4 rounded-md"
          style={{ backgroundColor: 'gray', width: '100%' }}
          key={job.id}
        >
          <CardContent>
            <Container component="main">
              <Grid container spacing={2}>
                <Grid item xs={12}>
                  <Table className="jobTable" style={{ tableLayout: 'fixed' }}>
                    <TableHead>
                      <TableRow>
                        <TableCell>Course ID</TableCell>
                        <TableCell>Term</TableCell>
                        <TableCell>Type</TableCell>
                        <TableCell>Num Positions</TableCell>
                        <TableCell>State</TableCell>
                        <TableCell>Actions</TableCell>
                      </TableRow>
                    </TableHead>
                    <TableBody>
                      <TableRow>
                        <TableCell>{job.Courseid}</TableCell>
                        <TableCell>{job.Term}</TableCell>
                        <TableCell>{job.Type}</TableCell>
                        <TableCell>{job.NumPositions}</TableCell>
                        <TableCell>{job.State}</TableCell>
                        <TableCell>
                          <Button
                            variant="contained"
                            style={{ backgroundColor: '#005293', color: 'white', width: '100%' }}
                            onClick={() => handleShowApplicants(job)}
                          >
                            Applicants
                          </Button>
                        </TableCell>
                      </TableRow>
                    </TableBody>
                  </Table>
                </Grid>
              </Grid>
            </Container>
          </CardContent>
        </Card>
      ))}
      {selectedJob && (
        <Popup title="Applicants" onClose={() => setShowPopup(false)}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Email</TableCell>
                <TableCell>Name</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {filteredUsers.map((user) => (
                <TableRow key={user.id}>
                  <TableCell>{user.Email}</TableCell>
                  <TableCell>{`${user.LName}, ${user.FName}`}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </Popup>
      )}
    </Container>
  );
};

export default JobList;
